import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
  card: {
    marginTop: 50,
    margin: '0 auto',
    maxWidth: 600
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between'
  },
  input: {
    marginBottom: 30
  },
  buttons: {
    width: '100%',
    display: 'flex',
    justifyContent: 'center'
  },
  title: {
    textAlign: 'center'
  },
  text: {
    width: '100%'
  }
});

export default useStyles;
